    <div className={classes.overlay}> <p>.</p></div>
    <p className={classes['big-heading']}>Get ready to vibe, create, and soar to new heights with vibini <span>Creates</span> - </p>
    <p>where events unfold, slots get booked, and creativity takes flight</p>
    <button className={classes['extra-margin']}>Host an Event</button>
 
  </div>
  );
};

